_905bbfecd4553ad91bbcdf9d334dfb1447caaf7afeae10cbec348349e1556936 = "PocketSuite is a YC-backed mobile platform for service professionals, independent businesses, freelancers, contractors, gigsters, part-time, and other non-traditional workers - helping them message, schedule and collect payment from their clients. PocketSuite empowers the U.S. market of 57 million freelancers, generating $1.2 trillion in sales with online platforms for running their business. Over 4 million appointments booked, $184M in payments processed, 18 million messages sent for businesses running on PocketSuite today. We are the stickiest SMB platform in the market. Once businesses onboard, they never look back. Who are we looking for? We are recruiting a founding engineer to help thousands [and growing] of small businesses run their business in a new, mobile optimized way. You will be working on any number of exciting projects from building industry leading (and App-Store featured) native mobile applications to building high performance, scalable backends for getting freelancers new clients, locking in recurring income, getting payments processed fast, growing their business. You are also helping to shape the next generation of business productivity and consumer convenience tools for the Fortune 10M (in the U.S.) and 750M globally. What will you be doing? Develop our mobile applications [Objective C, Android] Develop our payments, messaging and scheduling stack Develop our machine learning stack for payments and scheduling Develop & roll out unit test coverage in both mobile & backend stacks Build internal tools for code deployment, customer on-boarding / retention Are there any requirements? Bachelors degree in Computer Science [or equivalent] Expertise in at least 3 of the following: Objective C [iOS], Android, Python, SQL, Machine learning No one (reasonable) you know would describe you as an asshole. Every engineer you've worked with would rank you in their top 5 You should be able to ace our basic technical interview [no puzzles, no tricks] You sleep in between release cycle Your not into shining new things and Tech Crunch headlines You are all about building systems that create real value for real people - over the long term The details matter to you [premature optimizations, pixel level precision] and you take lots of pride in your work. Who we are? 1) Engineers and product obsessed - we loathe over-engineering, we cringe anytime a customer reports a bug and we release new versions every 3 weeks. 2) We love our customers - solving their problems and helping them grow and succeed in a rapidly changing market. Oh yeah we also love their 5 star reviews. 3) We love disrupting the status quo - desktop solutions are so last year and we believe everyone globally in the industries we're going after will be using a mobile app as their primary business tool by 2025. 4) We believe only three things matter as we build out our business: building a great product, delivering awesome customer service and a killer instinct for communicating what we do to the market."
_3920e62585070842db9dff466177940ee369dd923a5ae5df3867328cbc84c9ca = "Signal is hiring iOS developers to help make private communication simple. If you care about code quality as much as you care about user privacy, you should fit right in. This role is an opportunity to have an immediate impact while working closely with a talented team to solve challenging problems and ship new features to millions of users. Requirements Extensive familiarity with iOS development and internals. Comprehensive knowledge of Swift and Objective-C. Experience being the architect of major new enhancements. Capable of communicating effectively. We're a small organization; you will be involved in every aspect. Degree in Computer Science or related field. 5+ years of industry experience. Benefits You can work anywhere in the United States. Whether it’s your favorite coffee shop or your living room, Signal gives you the flexibility to work wherever you will be most effective. We fly somewhere new once a quarter so that everyone can meet up in person. Excellent healthcare, vision, and dental with all premiums covered. Our 401(k) plan matches your contributions (without any vesting period) up to the employee federal maximum of $19,000. We're stable, well-funded, and capable of focusing on what is best for users without distractions. Feel good about what you do. We believe in solving real problems, working with integrity, and sharing that work (and code) with everyone."
_cc8087173d6b932401c18b84640cc5e14a6fd58dabe138851328a71b1cd285dc = "Join our team We are looking for a passionate iOS developer who has a strong sense of ownership for his/her projects, great attention to details and a prime focus on time-to-market. This position requires deep customer-focused thinking, strong communications skills, self-motivation, and the willingness to work remotely. Your Responsibilities You take on full responsibility and ownership of your projects and strive to continuously improve it. You make it your top priority to burn down your assigned tickets and deliver your code in the highest quality possible within a given time frame. You keep your project manager and fellow developers regularly updated about your work status and show a high level of proficiency in your day-to-day project communication. You have a strong bias for action. You collaborate closely with QA and code reviewers to ensure high quality of your code. You don't just blindly implement requirements, but also think about the bigger picture. Your Attitude You love to build great code and you are passionate about your projects. You continuously challenge yourself to become better, you love to learn new things and you enjoy sharing your knowledge with others. You are smart and fun to work with. You bring a positive can-do attitude and you always try to find a solution for a problem yourself before asking your Team Lead. You are highly self-motivated and super reliable in your work. You are willing to go the extra mile for your team. You communicate proactively and directly with your team, and you don’t beat around the bush if there’s something that should be improved. You give and take on constructive criticism and you are willing to work on the items you can improve. You appreciate the freedom to work wherever you choose and you are happy to travel to our workshops and client meetings if necessary. Your Skills & Experience At least 5 years of coding experience. At least 3 years of mobile development in Swift & iOS You have published at least 3 apps on the App Store Experience with REST APIs and JSON Exceptional self-learning and self-motivation capabilities Experience with Networking, concurrency, GCD, GitHub. Fluent(!) in English - written and spoken Nice to have Firebase, Crashlytics, AppStore Connect, Contentful, Jira, Bitrise, CD/CI, Fastlane, Slack, Zeplin, GitLab Sketch, Wireframes, Frameworks. Experience with Swift design patterns, MVC, MVP, VIPER, MVVM. We offer Remote, and fun work environment based on Slack Full transparency in our processes and communication Team workshops at top locations all around Europe and the Middle East with fantastic teammates, burgers and beer ;-) People development tools like weekly masterclasses, regular 360-degree feedback from your teammates and 1:1s with your Team Lead A 10h - 40h work week depending on workload and your availability Compensation Freelance: 30-35€ /h (depending on your skills and experience), 12-month contract extending year to year with an option to mature to a Project Lead 40€ /h. Recruitment Process Please fill out the application form and attach your CV. If we are interested, we will schedule a quick 10m call with your future Team Lead to get to know each other, and talk about our mutual expectations. To evaluate your coding, language and architecture skills, we’d like to give you a small software assignment. No worries, it doesn’t hurt ;-). A 1-hour technical interview with your Team Lead and Project Lead to go through the assignment and evaluate some of your personal and technical skills If you have swapped us all off our feet, we will schedule a final call with your future Team Lead and our Founder & Managing Director Hannes to talk about next steps. Why stanwood? Stanwood helps companies unleash their true digital potential by creating beautifully designed, high-performing apps and websites that clients and users love. We help transform businesses by creating new sales channels and digital marketplaces for our customers, and we help them increase their productivity and profitability by digitizing and optimizing processes, implementing cutting-edge technology and tools and integrating existing business platforms into smart new solutions. Stanwood is a digital pioneer and role model for its clients. Our family of 40 tech enthusiasts and digital natives work together remotely from all over the world. We are not bound by offices or locations, digital technology is the glue that holds us together. Technology is a facilitator for us to work and live wherever we want, to work in an environment we love and where we can max out our potential and push our limits every day. Everything we do has one sole purpose: We want to build awesome software that our clients love, and we want to do it in the most fun way for us. Our team comes from a multitude of countries and cultural backgrounds. Diversity, openness and direct communication are the main keys to our success. We hire by attitude and train by skill. We prefer diverse, critical thinking over conformity. And we focus on quality, not working hours."
_9c00412d4d743abbb86a1b7a5f5d18e13b4d98d35c5ea6c5e1f8bcb08fa83b49 = "Be a part of something great Responsibilities Develop complex WordPress plugins and/or themes primarily using PHP. Mentor engineers and provide code reviews. Drive strategy and lead back end technical vision for large projects. Leverage WordPress APIs and extend the WordPress admin experience. Solve complex problems in simple ways. Solve bugs and address client issues in a fast-paced environment. Juggle current projects with incoming tasks. Respond directly to clients courteously and clearly. Solve client challenges with understanding and empathy. Test solutions across multiple browsers and platforms in a local testing environment. Deploy changes to live servers. Assist in the remediation, enhancement, and maintenance of client sites. Requirements At least five years experience in back end focused web development. Intermediate or expert skills in: PHP, JavaScript, React.js, jQuery, WordPress, HTML, CSS. Ability to expertly debug performance and caching issues. Code portfolio. Link us to your GitHub account, upload a .zip, or both. Experience using Git. Ability to setup a local environment for testing PHP code. Proficiency in verbal and written English. Ability to communicate professionally with technical and non-technical colleagues and clients."
_b8664479a9427b12f486f45a4c6095a42746d0b8b2193491bde2c9c637f968bb = "OhmConnect, the leader in consumer energy services, is seeking a seasoned Front-End Engineer and thought leader to join our team in creating innovative solutions that reimagine how people use energy. Role summary In your role as Senior Front-End Engineer, you will work closely with product management, business stakeholders, and engineering colleagues to deliver appealing applications with intuitive layouts. As we create new apps, you will play an integral role in decision making on the design, implementation and technology stack. About us We were created to improve the lives of people and the health of the planet by reimagining the way we use energy. We are tackling such a grand challenge by solving massive inefficiencies in energy markets, changing how people use and view energy, and connecting smart homes with the smart grid. At OhmConnect, we build products that connect deeply with the consumers and invite them to take action to positively impact the planet, people, and pocketbooks. What we do Our products encompass: Consumer-facing applications that use home automation control and user behavior modeling to shape consumer energy consumption. Integrations with a growing set of devices and appliances - smart plugs, thermostats, chargers, etc. Smart Meter data ingestion and analysis for consumer consumption forecast. Bidding, monitoring and settlement processes for the energy markets. Key responsibilities include Implement the interactive and visual elements of web and mobile applications. Design, develop, test and deploy code that is clean, robust and cross-browser compatible. Optimize applications for scalability and speed. Build libraries for future use. Perform peer code review, mentor junior developers. Participate in our agile development process. Desired skill set ‍ Expertise in raw JavaScript and modern JavaScript libraries such as ReactJS, React Native, Vue.js or similar. Good understanding of layout aesthetics. Advocate of design systems to ensure UI consistency. Experience with WPO (Web Performance Optimization) and web performance analysis. Solid understanding of web security, SEO, accessibility and internationalization. Experience with creating prototypes. Knowledge of professional software engineering practices & best practices for the full software development life cycle, including coding standards, code reviews, version control systems, build processes, testing, and operations. Outstanding written, presentation and communication skills. Evangelism experience a plus. 6+ years of experience in front-end development. 5+ years of experience in front-end web technologies. Bachelor's Degree in Computer Science or equivalent experience. Nice to have ‍ Experience with server-side languages such as Python. Experience with backend development and DB systems such as MySQL. What we offer ‍ Remote work environment with offices available for your convenience in San Francisco and South Bay. We are a ‘work-from-anywhere’ business with regular retreats as a team. We require monthly in-person interactions in the Bay Area. Outstanding benefits package, stock options, and salary commensurate with experience. A good work-life balance. Other company perks include unlimited vacation, commuter benefits, parental (both maternal and paternal) leave benefits. Equal Opportunity Employer who is committed to supporting equality and diversity. Contact Information: Please submit resume and brief cover letter to [email protected]"

